import React from "react";
import CyberGlobe from "../components/CyberGlobe";

const HackerPage = () => {
    return (
        <div className="hacker-mode">
            <h1>Welcome to Hacker Mode</h1>
            <p>This is your gateway to the matrix...</p>
            <CyberGlobe />
        </div>
    );
};

export default HackerPage;
